function drawTree(){
	let qw = 0.25;
	for(let i=0,h=1,a=25;i<str.length;i++){
		if(str[i]=="F"){
			stroke(44,116,28);
			strokeWeight(1);
		
			line(0,0,h*qw,-h);
			translate(h*qw,-h);
			
		}
		else if(str[i]=="-"){
			rotate(-a);
		}
		else if(str[i]=="+"){
			rotate(a);
		}
		else if(str[i]=="["){
			push();
		}
		else if(str[i]=="]"){
			pop();
		}
	}
}

